function assignSLDefaults()
{


  if((getPref("sl-defaults-assigned") && slData.slRootNodeParentId !== 1) || slData.rootSLNodeId !== -1)
  {
    return;
  }
  
  // set default prefs
  
  if(!getPref("sl-defaults-assigned"))
  {
    setPref("sl-defaults-assigned", 1);    
    setPref("sl-auto-arrange-groups", 1);  
    setPref("sl-hide-titles", 0);  
    setPref("sl-hide-keys", 0);    
    setPref("sl-open-new-tab", 0);       
    setPref("sl-grouping-on", 1); 
    setPref("sl-interface-mode-picked", 0);
    setPref("sl-launcher-theme", 6); 
  }
  
  assignDefaultShortcuts();  
}

